function App() {
  return (
    <div className="w-full h-screen">
      <img ClassName='top-0 left-0 w-full h-screen object-cover'
        src="https://images.pexels.com/photos/26746959/pexels-photo-26746959.jpeg" 
        alt="Close-up of a person holding a flower"
      />
      <div className='bg-black/30 absolute top-0 left-0 w-full h-screen'
      />
      <div>
        <div></div>
      </div>
    </div>
  );
}

export default App;
